import { useState } from "react";
import { useNavigate, Link } from "react-router-dom"; 
import { ClickAwayListener } from "@mui/material";
import { ArrowBackIosRounded, AccountCircle, Person, Settings, Logout, ArrowForwardIosRounded, ArrowDropUp, ArrowDropDown } from "@mui/icons-material"; // Removed unused imports
import styles from "./styles.module.scss";

const NavBar = () => {
    const [menu, setMenu] = useState(false);
    const navigate = useNavigate(); 

    return (
        <div className={styles.container}>
            {/*<div className={styles.left}>
                <div className={styles.icon} onClick={() => navigate(-1)}> 
                    <ArrowBackIosRounded />
                </div>
                <div className={styles.icon} onClick={() => navigate(+1)}>
                    <ArrowForwardIosRounded />
                </div>
    </div>*/}
            <div className={styles.right}>
                <div style={{backgroundColor: `${menu ? "#282828" : "#000"}`}} className={styles.profile_menu} onClick={() => setMenu(!menu)}>
                    <AccountCircle />
                    <p>ACCOUNT NAME</p>
                    {menu ? <ArrowDropUp /> : <ArrowDropDown />}
                </div>
            </div>
            {menu && (
                    <ClickAwayListener onClickAway = {() => setMenu(false)}>
                        <div className={styles.menu} onClick={() => setMenu(false)}>
                            <Link to="/me">
                                <div className={styles.options}>
                                    <p>Profile</p>
                                    <Person />
                                </div>
                            </Link>
                            <Link to="/settings">
                                <div className={styles.options}>
                                    <p>Settings</p>
                                    <Settings />
                                </div>
                            </Link>
                            <Link to="/">
                                <div className={styles.options}>
                                    <p>Logout</p>
                                    <Logout />
                                </div>
                            </Link>
                        </div>
                    </ClickAwayListener>
                )
            }
        </div>
    );
};

export default NavBar;
